description:
Sofia is the rich and handsome owner of an independent record label. Despite the vices to which he devoted himself spurred on by her lover of the moment did not take it the passion it nor the flair of his work. The encounter with a gypsy called &quot;The Prince&quot;, a charming traveling musician, makes finding the old pleasure of appreciating good music and take on the trails of a wild and unbridled sex. Sofia will bring &quot;The Prince&quot; to success ... But in turn will be driven with determination and firmness to savor the rich taste of the pleasures of the flesh.

